              <div class="stl_01" style="top: 0.5991em; left:13.1617em;"><span class="stl_07 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0725em;">台达 </span><span class="stl_10 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0725em;">PLC</span><span class="stl_07 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0725em;">通过 </span><span class="stl_10 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0725em;">USB</span><span class="stl_07 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0725em;">连接的远程维护操作 &nbsp;</span></div>
              <div class="stl_01" style="top: 3.3271em; left:7.502em;"><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.0377em;">台达 </span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.0377em;">PLC</span><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.0377em;">设备通过 </span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.0377em;">USB</span><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.0377em;">连接，由 </span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.0377em;">SS700</span><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.0377em;">进行远程维护时，具体操作如下： &nbsp;</span></div>
              <div class="stl_01" style="top: 5.264em; left:7.762em;"><span class="stl_15 stl_08 stl_16" style="font-weight:bold;">第一部分：</span><span class="stl_17 stl_08 stl_16" style="font-weight:bold;">PLC</span><span class="stl_15 stl_08 stl_16" style="font-weight:bold;">设备往云管理平台的添加 &nbsp;</span></div>
              <div class="stl_01" style="top: 7.2288em; left:7.482em;z-index:121; "><span class="stl_11 stl_12 stl_18">通过浏览器访问：</span><span class="stl_14 stl_12 stl_18">192.168.200.1</span><span class="stl_11 stl_12 stl_18">，进入智能远程模块管理后台之后点击“设备</span><span class="stl_14 stl_12 stl_18">&gt;USB</span><span class="stl_11 stl_12 stl_19" style="word-spacing:-0.2614em;">&nbsp;</span><span class="stl_11 stl_12 stl_20">”，</span><span class="stl_11 stl_12 stl_19" style="word-spacing:0.216em;">&nbsp;</span><span class="stl_11 stl_12 stl_21">先点“刷 &nbsp;</span></div>
              <div class="stl_01" style="top: 8.5287em; left:5.732em;"><span class="stl_11 stl_12 stl_22">新”按钮、再点“同步到云端”按钮，设备添加成功。 &nbsp;</span></div>
              <div class="stl_01" style="top: 23.8681em; left:7.762em;"><span class="stl_15 stl_08 stl_23" style="font-weight:bold;">第二部分：远程维护的操作 &nbsp;</span></div>
