              <div class="stl_01" style="top: 27.4113em; left:5.732em;z-index:253; "><span class="stl_11 stl_12 stl_27" style="word-spacing:0.0531em;">的 </span><span class="stl_14 stl_12 stl_27" style="word-spacing:0.0531em;">SS700</span><span class="stl_11 stl_12 stl_27" style="word-spacing:0.0531em;">，点击右边齿轮再点击“开始远程维护”。 &nbsp;</span></div>
              <div class="stl_01" style="top: 37.6113em; left:7.482em;z-index:299; "><span class="stl_11 stl_12 stl_28" style="word-spacing:0.0105em;">※第二步：打开台达 </span><span class="stl_14 stl_12 stl_28" style="word-spacing:0.0105em;">PLC</span><span class="stl_11 stl_12 stl_28" style="word-spacing:0.0105em;">编程软件 </span><span class="stl_14 stl_12 stl_28" style="word-spacing:0.0105em;">WPLSoft</span><span class="stl_11 stl_12 stl_28" style="word-spacing:0.0105em;">，先点击左边通信设置菜单下的“</span><span class="stl_14 stl_12 stl_28" style="word-spacing:0.0105em;">RS232</span><span class="stl_11 stl_12 stl_19" style="word-spacing:-0.2475em;">&nbsp;</span><span class="stl_11 stl_12 stl_29">”；</span><span class="stl_11 stl_12 stl_19" style="word-spacing:0.1591em;">&nbsp;</span><span class="stl_11 stl_12 stl_19">再点 &nbsp;</span></div>
